import React from 'react';

const Footer = () => {
    const styles = {
        footer: {
            backgroundColor: '#ffcc66',
            padding: '1rem 0',
            textAlign: 'center',
            fontFamily: 'Arial, sans-serif',
        },
        text: {
            fontSize: '1rem',
            color: '#333',
            margin: '0.5rem 0',
        },
        socialIcons: {
            display: 'flex',
            justifyContent: 'center',
            gap: '1rem',
            marginTop: '0.5rem',
        },
        icon: {
            textDecoration: 'none',
            fontSize: '1.5rem',
            color: '#3657a2',
        },
        iconHover: {
            color: '#2c4683',
        },
    };

    return (
        <footer style={styles.footer}>
            <p style={styles.text}>© 2024. Parašykite man.</p>
            <div style={styles.socialIcons}>
                <a style={styles.icon} href="#facebook">F</a>
                <a style={styles.icon} href="#instagram">I</a>
                <a style={styles.icon} href="#mail">M</a>
            </div>
        </footer>
    );
};

export default Footer;
